from collections import Counter

def commonChild(s1, s2):

    s1=s1+"+"
    s2=s2+"-"
    s3 = [[0]*len(s2) for x in range(len(s1)) ]
    #print(s3)

    for i in range(len(s1)):
        for j in range(len(s2)):
            if i-1>=0 and j-1>=0 and  s1[i-1]==s2[j-1]:
                #print(i-1,j-1,s1[i-1],s2[j-1])
                s3[i][j] = s3[i-1][j-1]+1
            else:
                s3[i][j] = max(s3[i][j-1],s3[i-1][j])

    #print(s3)#
    return s3[-1][-1]

print(commonChild("ABCDEF","FBDAMN"))
print()
print(commonChild("SHINCHAN","NOHARAAA"))
print()
print(commonChild("AA","BB"))
print(commonChild("HARRY","SALLY"))


